import React from 'react';
import { Disclosure } from '@headlessui/react';
import { ChevronUpIcon } from '@heroicons/react/20/solid';

// ---------- DATA ----------
const publications = [
  {
    title: 'Psychological Trait Analysis Using Tweets (IEEE InC4 \'24)',
    tech: 'Python, Deep Learning, NLP',
    tags: ['#NLP', '#MentalHealth', '#DeepLearning', '#Publication'],
    description:
      'Co-authored a peer-reviewed paper accepted at IEEE InC4 2024. Proposed a hybrid CNN-LSTM model to detect psychological traits from Twitter data with 99%+ accuracy.',
    link: 'https://ieeexplore.ieee.org/document/10574935',
  },
];

const projects = [
  {
    title: 'Previous Contact and Subscription Rates',
    tech: 'Python, Scikit-learn, Causal Inference',
    tags: ['#Marketing', '#CausalInference', '#Banking'],
    description:
      'Causal analysis of bank marketing data to estimate the effect of prior outreach on subscription likelihood. Used PSM and Causal Forests to control for bias.',
    link: 'https://github.com/utkarshg06/Previous_Contact_and_Subscription_Rates_Market_Analytics',
  },
  {
    title: 'Duke Health – CMS Coverage & Health Outcomes',
    tech: 'R, SQL, Tableau',
    tags: ['#Healthcare', '#Policy', '#CausalInference'],
    description:
      'Capstone with Duke Health to assess Medicaid expansion’s impact on chronic disease outcomes. Used DiD and fixed-effects models to derive policy-level insights.',
    link: 'https://github.com/utkarshg06/Duke_Health_CMS_Coverage_Health_Outcomes',
  },
  {
    title: 'Pyramyd.AI – Predictive Bidding Engine',
    tech: 'Python, LightGBM, FastAPI',
    tags: ['#AdTech', '#ML', '#FastAPI'],
    description:
      'Built a predictive bidding engine to optimize Google Ads for legal services. Combined LightGBM with legal signals and served results via FastAPI.',
    link: 'https://github.com/lavyam/PyramydAI-API',
  },
  {
    title: 'Major Project – Psychological Trait Detection',
    tech: 'Python, Deep Learning, NLP',
    tags: ['#MentalHealth', '#NLP', '#DeepLearning'],
    description:
      'Developed a hybrid LSTM-CNN model to identify depression and anxiety indicators from tweets. Achieved over 99% classification accuracy.',
    link: 'https://github.com/kartiksingh11/Major_Project',
  },
];

// ---------- COMPONENT ----------
const Projects = () => (
  <section className="max-w-5xl mx-auto p-6 space-y-10">
    <div>
      <h2 className="text-3xl font-bold mb-4">Publications</h2>
      <div className="space-y-4">
        {publications.map((pub, idx) => (
          <Disclosure key={idx}>
            {({ open }) => (
              <div className="border border-gray-300 dark:border-gray-600 rounded-lg p-4">
                <Disclosure.Button className="flex justify-between w-full text-left text-lg font-medium text-indigo-700 dark:text-indigo-300">
                  <span>{pub.title}</span>
                  <ChevronUpIcon
                    className={`${
                      open ? 'rotate-180 transform' : ''
                    } h-5 w-5 text-indigo-500`}
                  />
                </Disclosure.Button>
                <Disclosure.Panel className="pt-3 text-sm text-gray-600 dark:text-gray-300">
                  <p className="mb-1"><strong>Tech Stack:</strong> {pub.tech}</p>
                  <p className="mb-1">{pub.description}</p>
                  <div className="mb-2 flex flex-wrap gap-2">
                    {pub.tags.map((tag, i) => (
                      <span
                        key={i}
                        className="bg-indigo-100 dark:bg-indigo-800 text-indigo-800 dark:text-indigo-200 px-2 py-0.5 rounded-full text-xs"
                      >
                        {tag}
                      </span>
                    ))}
                  </div>
                  <a
                    href={pub.link}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-indigo-600 dark:text-indigo-300 underline"
                  >
                    View Publication ↗
                  </a>
                </Disclosure.Panel>
              </div>
            )}
          </Disclosure>
        ))}
      </div>
    </div>

    <div>
      <h2 className="text-3xl font-bold mb-4">Projects</h2>
      <div className="space-y-4">
        {projects.map((project, idx) => (
          <Disclosure key={idx}>
            {({ open }) => (
              <div className="border border-gray-300 dark:border-gray-600 rounded-lg p-4">
                <Disclosure.Button className="flex justify-between w-full text-left text-lg font-medium text-indigo-700 dark:text-indigo-300">
                  <span>{project.title}</span>
                  <ChevronUpIcon
                    className={`${
                      open ? 'rotate-180 transform' : ''
                    } h-5 w-5 text-indigo-500`}
                  />
                </Disclosure.Button>
                <Disclosure.Panel className="pt-3 text-sm text-gray-600 dark:text-gray-300">
                  <p className="mb-1"><strong>Tech Stack:</strong> {project.tech}</p>
                  <p className="mb-1">{project.description}</p>
                  <div className="mb-2 flex flex-wrap gap-2">
                    {project.tags.map((tag, i) => (
                      <span
                        key={i}
                        className="bg-indigo-100 dark:bg-indigo-800 text-indigo-800 dark:text-indigo-200 px-2 py-0.5 rounded-full text-xs"
                      >
                        {tag}
                      </span>
                    ))}
                  </div>
                  <a
                    href={project.link}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-indigo-600 dark:text-indigo-300 underline"
                  >
                    View Project ↗
                  </a>
                </Disclosure.Panel>
              </div>
            )}
          </Disclosure>
        ))}
      </div>
    </div>
  </section>
);

export default Projects;
